import { Button, Flowbite } from 'flowbite-react';
import React from 'react';

const customTheme = {
    color: {
        black: '#0d1728',
        blackGray: '#11242e',
        blue: '#00B7FF',
        white: '#FFF',
    },
};


export default function CustomBtn({ color }) {
    return (
        <Flowbite theme={customTheme}>
            <Button color={color}>Đăng nhập</Button>
        </Flowbite>
    );
}
